import React, { Component } from "react";
import MainHeader from "./MainHeader";
import Dashboard from "./Dashboard";

export class MainPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLogedIn: false,
      newsletter: false,
      logedInUsername: "",
    };
  }

  parentFunction = (loggedIn, user, news) => {
    this.setState({
      isLogedIn: loggedIn,
      logedInUsername: user,
      newsletter: news,
    });
    console.log(this.state.isLogedIn);
  };

  render() {
    return (
      <div>
        <div>
          <MainHeader
            callFromParent={this.parentFunction.bind(this)}
          ></MainHeader>
        </div>
        <div>
          <Dashboard userLogedIn={this.state.isLogedIn}></Dashboard>
        </div>
      </div>
    );
  }
}

export default MainPage;
